import Layout from '../components/Layout';
const MYProperties = () =>(
    <Layout title="PROPERTY">
        <div className='container'>
            <div className='row'>
                <div className='col-sm-12'>
                    <h4>MY PROPERTIES</h4>
                </div>

            </div>
        </div>
    </Layout>
)
export default MYProperties;
